import React from "react";

function about(){
    return(
        <div className="condiv about">
            <h1 className="subtopic"> About Me</h1>
            <h3>สวัสดีครับ ผมชื่อการันต์ ชะดี</h3>
            <p>เป็นผู้พัฒนาเว็บและผู้พัฒนาโปรแกรม ERP 
                และยังมีประสบการณ์ในการประสานงานกับผู้มีส่วนเกี่ยวข้องด้วย 
                เป็นคนชอบลงอะไรใหม่ๆ อยากเก่งขึ้นไปเรื่อยๆ</p>
            <p>มีแฟนชื่อ จริยา คณาญาติ เป็นคนน่ารักมากๆ</p>
        </div>
    )
}

export default about
